tables.table_schema:
CREATE TABLE ARVRUsers (
    user_id INT PRIMARY KEY,
    username VARCHAR(50),
    email VARCHAR(100),
    access_level INT
);

CREATE TABLE environment_data (
    id INT PRIMARY KEY,
    location VARCHAR(255),
    temperature FLOAT,
    humidity FLOAT
);

CREATE TABLE virtual_objects (
    id INT PRIMARY KEY,
    object_name VARCHAR(255),
    object_type VARCHAR(50),
    location_id INT
);

CREATE TABLE Environment (
  id INT PRIMARY KEY,
  name VARCHAR(255),
  description TEXT
);

CREATE TABLE Objects (
  id INT PRIMARY KEY,
  name VARCHAR(255),
  type VARCHAR(50),
  location VARCHAR(100)
);

CREATE TABLE Users (
  id INT PRIMARY KEY,
  username VARCHAR(50) UNIQUE,
  email VARCHAR(100) UNIQUE
);
